import "./styles/BadgeNew.css";
import "./styles/Badges.css";
import "./styles/Home.css";

class Home extends React.Component {
  render() {
    return (
      <React.Fragment >

          <div className="Home__page">
              <h1>hola</h1>
          </div>

      </React.Fragment>
    );
  }
}

export default Home;
